import React from "react";
import "../Principal.css";

export default function Principal() {
  const funcionarios = [
    "Funcionario 1",
    "Funcionario 2",
    "Funcionario 3",
    "Funcionario 4",
    "Funcionario 5",
    "Funcionario 6",
    "Funcionario 7",
    "Funcionario 8",
  ];

  return (
    <div className="vista1-container">
      {/* Banner */}
      <div className="banner">
        <div
          className="logo"
          style={{
            backgroundImage: "url('/image.png')",
            backgroundSize: "contain",
            backgroundRepeat: "no-repeat",
          }}
        ></div>
        <div className="portal-title">Portal de Medicamentos ELEAM</div>
        <button className="btn-login">Iniciar Sesión</button>
        <button className="btn-diagnostico">Diagnóstico Paciente</button>
      </div>

      {/* Funcionarios */}
      <div className="funcionarios-container">
        {funcionarios.map((nombre, index) => (
          <div
            key={index}
            className="funcionario"
            style={{
              backgroundImage: "url('/funcionario.png')",
              backgroundSize: "cover",
              backgroundPosition: "center",
            }}
          ></div>
        ))}
      </div>
    </div>
  );
}
